import React from 'react';
import Container, { NewChat } from '../styles/s_app.tw';

const App = () => {
    return (
        <Container>
            <div style={{borderColor: '#E6E5EA'}} className="w-2/6 inline-flex flex-col align-top border-r h-full">
                <div className="w-full h-1/6 bg-gray-700 text-center">
                    <NewChat type="button" >
                        New Conversation
                        <div className="absolute inset-y-0 right-0">
                           <svg height="32px" id="Layer_1" style={{enableBackground: 'new 0 0 32 32'}} version="1.1" viewBox="0 0 32 32" width="32px" xmlns="http://www.w3.org/2000/svg" ><path d="M28,14H18V4c0-1.104-0.896-2-2-2s-2,0.896-2,2v10H4c-1.104,0-2,0.896-2,2s0.896,2,2,2h10v10c0,1.104,0.896,2,2,2  s2-0.896,2-2V18h10c1.104,0,2-0.896,2-2S29.104,14,28,14z"></path></svg>
                        </div>
                    </NewChat>
                </div>
                <div className="w-full h-1/6 bg-gray-800">

                </div>
                <div className="w-full h-4/6 bg-gray-900">

                </div>
            </div>
            <div className="w-4/6 inline-flex h-full">

            </div>
        </Container>
    );
}

export default App;
